import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Sudoku Solver</h1>
      <table>
        <tbody>
          <td>
          <input className="inputsection"/>
          </td>
        </tbody>
      </table>

    </div>
  );
}

export default App;
